import {Image, ScrollView, StyleSheet, TouchableOpacity} from 'react-native';
import OnBoarding from '../components/OnBoarding';
import { Text, View } from '../components/Themed';
import Forms  from '../components/Forms';
import { RootTabScreenProps } from '../../types';
import {Dimensions} from 'react-native'

const coffee = require('../assets/images/coffee.png');
const art = require('../assets/images/art.png');
const cooking = require('../assets/images/cooking.png');
const music = require('../assets/images/music.png');
const sport = require('../assets/images/sport.png');

const DeviceWidth = Dimensions.get('window').width

export default function TabOneScreen({ navigation }: RootTabScreenProps<'TabOne'>) {
    return (
        <ScrollView>
        <View style={styles.container}>
      {/*<Text style={styles.title}>Tab One</Text>Text*/}
      {/*<View style={styles.separator} lightColor="#eee" darkColor="rgba(255,255,255,0.1)" />*/}
      {/*<EditScreenInfo path="/screens/TabOneScreen.tsx" />*/}
      {/*  <OnBoarding*/}
      {/*    title={"hehe"}*/}
      {/*    subtitle={"hehe"}*/}
      {/*    img={coffee}/>*/}

            <View style={{
                flexDirection: 'row',
                flex: 1,
                justifyContent: 'center',
                alignItems: 'center',
            }}>
                <View>
                    <View style={{marginRight:5, marginBottom:10}}>
                        <TouchableOpacity>
                            <Image style={{width: 150,height: 130,resizeMode: "contain"}} source={{uri: art}}/>
                        </TouchableOpacity>
                    </View>
                    <View style={{marginRight:5, marginBottom:10}}>
                        <TouchableOpacity>
                                <Image style={{width: 150,height: 130,resizeMode: "contain"}} source={{uri: cooking}}/>
                            </TouchableOpacity>
                    </View>
                </View>
                <View>
                    <View style={{marginRight:5, marginBottom:10}}>
                        <TouchableOpacity>
                            <Image style={{width: 150,height: 130,resizeMode: "contain"}} source={{uri: music}}/>
                        </TouchableOpacity>
                    </View>
                    <View style={{marginRight:5, marginBottom:10}}>
                        <TouchableOpacity>
                            <Image style={{width: 150,height: 130,resizeMode: "contain"}} source={{uri: sport}}/>
                        </TouchableOpacity>
                    </View>
                </View>
            </View>
            <Forms
            placeholder={"Anjay"}/>
        </View>
        </ScrollView>
);
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    alignItems: 'center',
    justifyContent: 'center',
  },
  title: {
    fontSize: 20,
    fontWeight: 'bold',
  },
  separator: {
    marginVertical: 30,
    height: 1,
    width: '80%',
  },
});
